export default
function greeting(name){
    const d = new Date()
    // alert(d.getHours())
    if(d >= 4 || d <= 11)
    alert(`Good Morning ${name}`)
    else if(d >= 12 || d <= 16)
    alert(`Good afternoon ${name}`)
    else if(d >= 17 || d <= 19)
    alert(`evening ${name}`)
    else if(d >= 20 || d <= 3)
    alert(`night ${name}`)
}
greeting('Leo')
